$(document).ready(function(){ 

		//리그선택하기 버튼
		$(".leagueChoice > a").click(function(){ 
			$(this).parent().find(".choice_w").slideDown();
			$(this).parent().find(".choice").slideDown();
			return false;
		});
		$(".popup_w2").click(function(){ 
			$(this).parent().slideUp();
			return false;
		});

		//date
		$(".date_num").click(function(){ 
			var state = $(this).next().css('display'); 
			if(state == 'none'){ 
				$(this).addClass("on");			
				$(this).siblings().removeClass("on");
				$(this).parent().find(".date_ul").slideUp();
				$(this).next().slideDown();
				return false;
			}else{
				$(this).next().slideUp();
			}

		});
		


		//liveview
		$(".ing_BTN a").click(function(){ 
			var state = $(this).parents().next(".liveView").css('display'); 
			if(state == 'none'){ 
				$(this).parents().find(".liveView").slideUp();
				$(this).parents(".soccer_table").find(".redbox").addClass("open");
				$(".popup").slideUp();
				$(".choice").slideUp();
				$(this).parents(".soccer_table_w").find(".liveView").slideDown(); 
			    return false;
			}else{
				$(this).parents(".soccer_table_w").find(".liveView").slideUp();
				$(this).parents().find(".redbox").removeClass("open");
				$(".popup").slideUp();
				$(".choice").slideUp();
				return false;
			}
		});

		//leagueChoice_메뉴
		$(".leagueC1 > a").click(function(){ 
			var state = $(this).siblings(".leagueC1_v").css("display"); 
			if(state == "none"){ 
				$(".leagueC1_v").slideUp(); 
				$(this).siblings(".leagueC1_v").slideDown(); 
				$(this).addClass("close");
				return false;
			}else{
				$(this).siblings(".leagueC1_v").slideUp(); 	
				$(this).removeClass("close");
				return false;
			}
		});
		$(".leagueC2 > a").click(function(){ 
			var state = $(this).siblings(".leagueC2_v").css("display"); 
			if(state == "none"){ 
				$(".leagueC2_v").slideUp(); 
				$(this).siblings(".leagueC2_v").slideDown(); 
				$(this).addClass("close");
				return false;
			}else{
				$(this).siblings(".leagueC2_v").slideUp(); 	
				$(this).removeClass("close");
				return false;
			}
		});
		$(".list_close").click(function(){ 
			$(this).parent().slideUp();
			return false;
		});

	});



		
